// Hàm tính tổng hợp theo DescriptionId (bao gồm cả Estimate và Actual)
function groupByDescriptionIdAndCurrency(data, isEstimate = false, exchangeRates = {}) {
    return data.reduce((acc, curr) => {
        const key = `${curr.DescriptionId}_${curr.CurrencyId}`; // Ghép DescriptionId và CurrencyId thành khóa duy nhất
        if (!acc[key]) {
            acc[key] = {
                Estimate: this.Decimal(0),
                Actual: this.Decimal(0),
                CurrencyId: curr.CurrencyId
            };
        }

        // Lấy tỷ giá: ưu tiên từ exchangeRates hoặc từ chính curr.ExchangeRateVND
        const exchangeRate = exchangeRates[key] || this.Decimal(curr.ExchangeRateVND || 0);

        if (isEstimate) {
            // Tổng hợp Estimate
            acc[key].Estimate = acc[key].Estimate.plus(
                this.Decimal(curr.TotalAmount || 0).times(exchangeRate)
            );
        } else {
            // Tổng hợp Actual
            acc[key].Actual = acc[key].Actual.plus(
                this.Decimal(curr.TotalAmount || 0).times(exchangeRate)
            );
        }

        return acc;
    }, {});
}

